import { Link } from "react-router-dom";
function ProductPage() {
  return (
    <>
      <h1>The Product Page</h1>
      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </>
  );
}

export default ProductPage;
